import React from "react";
import image9 from "./images/image9.png";

export default function Header(){
    return(
        <div className="container-align">
            <div className="header-css">
                <p>Home</p>
                <p>Tournaments</p>
                <p>Press Corner</p>
                <img src={image9}/>
                <p>Initiatives</p>
                <p>About Us</p>
                <p>Login</p> 
            </div>
        </div>
    )
}
